    <div className='AppStyle'>
      <Routes>
        <Route exact path="/" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="*" element={<Error />} />
        {/* {(user==="admin"&& password==="admin")?
        <Route path='/home' element={<Home/>}/>  
        :navigate.push('/')
        } */}
      </Routes>

    </div>
  );
}

export default App;
